import { Provider } from "react-redux";
import "./App.css";
import Header from "./components/Header";
import store from "./redux/store";

function App() {
  return (
    <Provider store={store}>
      <div className="App">
        <div className="row"></div>
        <Header />
      </div>
    </Provider>
  );
}

export default App;
